import React, { Component } from 'react'
import './App.css';


class App extends Component {

  state = { 
    count:0,
  }

  increase=()=>{
    this.setState({
      count:this
    })
  }

  render() { 
    return ( 
      <div className="App">
        <button>+</button>
        <span>{this.state.count}</span>
        <button>-</button>
      </div>
    );
  }
}

export default App;
